function convertion(mappingObj,arrayObj){
    //console.log("hi");
    var newArr=[];
    $.each(arrayObj,function(){
        var newObj={};
        $.each( this, function( key, value ) {
            newObj[mappingObj[key]]=value;
        });
        newArr.push(newObj);
    });
    //console.log(newArr);
    output(mappingObj,arrayObj,newArr);
};
function output(mappingObj,arrayObj,newArr){
    $("#dvOutput").append(
        "<div class='col-sm-4'>"+
            "<div>Original Object</div>"+
            "<div>"+
                "<pre>"+JSON.stringify(arrayObj, null, 4)+"</pre>"+
            "</div>"+
        "</div>"+
        "<div class='col-sm-4'>"+
            "<div>Mapping Object</div>"+
            "<div>"+
                "<pre>"+JSON.stringify(mappingObj, null, 4)+"</pre>"+
            "</div>"+
        "</div>"+
        "<div class='col-sm-4'>"+
            "<div>Converted Object</div>"+
            "<div>"+
                "<pre>"+JSON.stringify(newArr, null, 4)+"</pre>"+
            "</div>"+
        "</div>"
    );
}
